export const newsletter = {
  title: "Subscribe to our newsletter",
  subtitle: "and receive updates on new game uploads",
  form: [
    {
      text: "Fullname",
      type: "text",
    },
    {
      text: "Email",
      type: "email",
    },
  ],
  buttonText: "Subscribe",
  submit: {
    image: {
      src: "../images/vector.png",
      alt: "done",
    },
    title: "Thank You",
    subtext: "You are now subscribed to newsletter.",
  },
};
